import React from "react";
import { Col, Row, Container } from "../components/Grid";
import Signup from "../components/SignUp";

const Index = () => {
  return (
    <Container fluid>
      <Signup />
      <br />
      <a href="/home">Login bypass</a>
    </Container>
  );
};

export default Index;
